import React from 'react';

import Toolbar from "./components/Toolbar";

function App(props) {

  return (
    <div className="App">
        <Toolbar
            filters={["All", "Websites", "Flayers", "Business Cards"]}
            selected="All"
            onSelectFilter={(filter) => {console.log(filter);}}/>
    </div>
  );
}

export default App;
